svg.script:
var createElement = document.createElement
document.createElement = function( elem ) {
  var newElem = createElement.apply( this, arguments )
  if( newElem.style == null && elem == 'div' ) {
    newElem = document.createElementNS( 'http://www.w3.org/1999/xhtml', elem )
  }
  return newElem
}
